import {Box} from "@mui/material";
import Header from "../../components/Header";

const dashboard=()=>{
    return <Box m="20px">
        <Box display="flex" justifyContent="space-between" align>
        <Header title = "DASHBOARD" subtitle ="Welcome to your dashboard" />
        </Box>
        </Box>
};
export default dashboard;
